import React from 'react';
import ReactDOM from 'react-dom/client'; // 使用 React 18 的新 API
import './index.css'; // 确保正确导入
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root')); // 使用 createRoot
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
